function getCityCode(cityName) {
  let cityCode = ""
  for (var i = 0; i < cityObj.length; i++) {
    if (cityObj[i].stationName == cityName) {
      cityCode = cityObj[i].teleCode
      break
    }
  }
  return cityCode
}


function getCityName(cityCode) {
  let cityName = ""
  for (var i = 0; i < cityObj.length; i++) {
    if (cityObj[i].teleCode == cityCode) {
      cityName = cityObj[i].stationName
      break
    }
  }
  return cityName
}


/** 
  * 
  * json转字符串 
  */
function stringToJson(data) {

  return JSON.parse(data);
}

function str2list(data) {

  var list = []
  var datas = data.split("-")
  for (var i = 0; i < data.length - 1; i++) {
    list.push(data[i])
  }
  return list
}

function saveList(list) {
  var temp = ""
  for (var i = 0; i < list.length; i++) {
    temp += list[i]
    if (i != list.length - 1) {
      temp += "-"
    }
  }
  wx.setStorageSync("history", temp)
}

function getHeaders() {
  var headers = {
    "Content-Type": "application/x-www-form-urlencoded",
    "Accept": "application/json"
  }
  if (wx.getStorageSync("header")) {
    headers.Authorization = "Bearer " + wx.getStorageSync("header")
  }
  return headers
}

function getUserinfos(callback) {//获取用户信息
  var that = this
  wx.getUserInfo({
    withCredentials: true,
    lang: '',
    success: function (res) {
      console.log(res)
      that.loginserver(wx.getStorageSync("token"), res.userInfo.nickName, res.userInfo.avatarUrl, callback)
    },
    fail: function (res) {
      wx.showModal({
        title: '提示',
        content: '授权拒绝将无法使用收藏功能，请谨慎选择',
        showCancel: false,
        cancelText: '',
        cancelColor: '',
        confirmText: '确认',
        confirmColor: '',
        success: function (res) {
          wx.openSetting({
            success: function (res) {
              if (res.authSetting["scope.userInfo"]) {
                that.getUserinfos()
              }
            },
            fail: function (res) { },
            complete: function (res) { },
          })
        },
        fail: function (res) { },
        complete: function (res) { },
      })


    },
    complete: function (res) {
      console.debug(res)
    },
  })

}

function loginserver(token, nick_name, face, callback) {//服务器登录
  wx.request({
    url: globaldata.wxappUrl,
    data: {
      token: token,
      nick_name: nick_name,
      face: face
    },
    header: {},
    method: 'POST',
    dataType: 'json',
    responseType: 'text',
    success: function (res) {
      console.log(res.data.data.token)
      if (res.data.code == 1) {
        wx.setStorageSync("header", res.data.data.token)
        wx.showToast({
          title: '登录成功',
          icon: 'success',
          image: '',
          duration: 1500,
          mask: true,
        })
        if (callback && typeof callback == "function")
          callback()
      }
    },
    fail: function (res) { },
    complete: function (res) { },
  })
}


module.exports = {
  getCityCode: getCityCode,
  getCityName: getCityName,
  stringToJson: stringToJson,
  saveList: saveList,
  getHeaders: getHeaders,
  loginserver: loginserver,
  getUserinfos: getUserinfos,
}
